import React from 'react';
import Authorization from "./authorization";
import {connect} from "react-redux";
import {auth, updateEmail, updatePassword, validEmail, validPassword} from "../../../redux/authReducer";
import centrifuger from './centrifuge';

class AuthorizationContainer extends React.Component{

    componentDidMount() {
        let centrifuge = new centrifuger.Centrifuge('ws://192.168.3.105:8000/connection/websocket');

    //     centrifuge.subscribe("calc", function(message) {
